  Side Scan Sonar and Swath Bathymetry Data Collected During USGS Cruise 13CCT04 Offshore
  of Petit Bois Island, Gulf Islands National Seashore, Mississippi, August 2014\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-10T06:16:36.945208\",\n\t\"name\": \"archive-of-side-scan-sonar-and-swath-bathymetry-data-collected-during-usgs-cruise-13cct04-2014\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In August of 2013, the U.S. Geological
  Survey (USGS) conducted geophysical surveys offshore of Petit Bois Island, Mississippi.
  These efforts are a continued part of the U.S. Geological Survey Gulf of Mexico
  Science Coordination partnership with the U.S. Army Corps of Engineers (USACE) to
  assist the Mississippi Coastal Improvements Program (MsCIP) and the Northern Gulf
  of Mexico (NGOM) Ecosystem Change and Hazards Susceptibility Project, by mapping
  the shallow geologic stratigraphic framework of the Mississippi Barrier Island Complex.
  These geophysical surveys will provide the data necessary for scientists to define,
  interpret, and provide baseline bathymetry and seafloor habitat for this area to
  aid scientists in predicting future geomorphological changes to the islands with
  respect to climate change, storm impacts, and sea level rise. Furthermore, these
  data combined with the geomorphological results will provide the properties and
  extent of local offshore sand sediment resources available for planning and execution
  of the Gulf Islands National Seashore barrier island restoration. The geophysical
  data were collected during one cruise (USGS Field Activity Numbers 13CCT04) aboard
  the University of Southern Mississippi Research Vessel Tommy Munro offshore along
  the gulf side of Petit Bois Island, Gulf Islands National Seashore, Mississippi.
  Data were acquired with the following equipment: a Systems Engineering and Assessment,
  Ltd., SWATHplus interferometric sonar (468 kilohertz (kHz)), an EdgeTech 424 (4-24
  kHz), an EdgeTech 525i chirp sub-bottom profiling system, and a Klein 3900 sidescan
  sonar system. This report serves as an archive of the processed interferometric
  swath bathymetry and sidescan sonar data. Geographic information system data products
  include an interpolated digital elevation model, an acoustic backscatter mosaic,
  a trackline map, and point data files. Additional files include error analysis maps,
  Field Activity Collection System logs, and formal Federal Geographic Data Committee
  metadata. NOTE: These data are scientific in nature and are not to be used for navigation.
  Any use of trade names is for descriptive purposes only and does not imply endorsement
  by the U.S. Government.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
